import React from "react";
import logo_black from "../asset/logo_black.svg";

const Footer = () => {
  return (
    <footer className="section">
      <div className="footer">
        <div className="footer__logo">
          <img className="footer__logo--image" src={logo_black}></img>
        </div>
        <div className="footer__links">
          <div className="footer_link footer__links--1">Shop</div>
          <div className="footer_link  footer__links--2">About</div>
          <div className="footer_link  footer__links--3">Contact</div>
          <div className="footer_link  footer__links--4">Home</div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
